import React from "react";
import { NavLink, withRouter } from "react-router-dom";
import "./css/navbar.css";

const Navbar = props => {
  //home icon and link
  let homeLink =
    props.location.pathname !== "/" ? (
      <NavLink to="/">
        <img
          className="iconStyle"
          src={require("../imgs/homeIcon.png")}
          alt="homeIcon"
        />
      </NavLink>
    ) : null;

  return (
    <div className="navbar-parent-main-div" style={divFlexboxRow}>
      {homeLink}
    </div>
  );
};

export default withRouter(Navbar);
